import { Typography } from "@mui/material";

const UserSearch = () => {
    return (
        <main>
            <Typography 
                variant="h1" 
                component="h2"
                color='primary'
                boxShadow='9'
            >
            hello MUI</Typography>
            <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
        </main>
    );
}
export default UserSearch;
